@distributed・38 we've just released an update to take us up to v1.0.7. This addresses an issue we've been seeing where miners losses increase after an AllReduce thereby negatively impacting our overall convergence speed. 

We identified that the method we where using to reset the gradients of our Averagers was breaking links to the original model parameters and therefore resetting the model each AllReduce. With this fix we think we can we can get back to the our normal AllReduce schedule and hopefully start demonstrating even faster global model convergence.

Miners / Validators that aren't running with auto-updates please update to this latest version as soon as you can.

@distributed・38  we've just merged https://github.com/KMFODA/DistributedTraining/pull/58 to take us up to v1.0.11. This PR addresses the issues miners where seeing early today after failing an AllReduce call and trying to load the latest global model state. This also cleans up the tags on wandb and only resets a wandb run if the run_id changes.

Miners should start seeing cleaner train_scores and they should get unanimous all_reduce_scores = 1 across all validators once they successfully complete AllReduce call.

Miners / Validators that aren't running with auto-updates please update to this latest version as soon as you can.
